snippet.textDisplay:
No wonder skies used to sprinkle water when classical music was performed in old days. Never heard Hina before and what a crime that was. Loved the combination of hers with Amanat Ali’s quietness and what a transformation from him in second antra! Absolutely stunning! Imagine what a well sung ghazal can still achieve in 2017! I wish more people take to ghazal singing. Hina starts with classical and rests towards ghazalnuma-classical rendition. Excellent first attempt in the studio Mr. Bagga! Not often you see Mannu leaking emotion and reassuring to see momo nodding along…loved it and did we just see uncle Jay in his new haircut! Feels like home listening to shades of megh in composition this time of year sitting far away from home and looks like home - seeing old faces here..

Love from India
@Rohwit

